import React from 'react';
import logo from './logo.svg';
import './App.css';

function nama(element) {

if (element.nama == "ia") {
  return element.nama + " " + element.kk;
}
  return "maaf slah";
}

const element = {
  nama: 'deni',
  kk:'denot'
}

const spec = "gg";


const tampil=nama(element);
const dandi = <div> tes  {spec}</div>;

function Welcome(props) {
  return <h1>Hello, {props.name}</h1>;
}

function App(props) {

  const time = (
    <div>
      <h1>Hello, world!</h1>
      <h2>It is {new Date().toLocaleTimeString()}.</h2>
    </div>
  );
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit {time} {new Date().toLocaleTimeString()}  <code>src/App.js</code> and save to reload. <br /> {nama(element)} {dandi} {tampil}
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React 
        </a>
        <Welcome name="dandi" />
      </header>
    </div>
  );
}

export default App;
setInterval(App,1000);
